import React from 'react';

const Resume = (
  id, firstname, lastname, age, gender, email, profile, address, phone, favoriteFilm, salary, about
) => {

  return(
    <div className="resume">
      <p>{'Имя: ' +  firstname}</p>
      <p>Фамилия: </p>
      <p>Возраст: </p>
      <p>Пол: </p>
      <p>Потча: </p>
      <p>Направление: </p>
      <p>Адрес: </p>
      <p>Телефон: </p>
      <p>Любимый фильм: </p>
      <p>З/п: </p>
      <p>О себе: </p>
    </div>
  )
}

export default Resume;
